INSERT INTO `t_article` VALUES (18,'公司制度-zzhnokia','日日日1212121-zzhnokia',66,206,1,'2019-12-26 09:56:20','2019-12-26 09:56:21'),(28,'公司制度','12121212121=====',66,206,0,'2019-12-26 07:40:05','2019-12-26 07:40:06'),(45,'聚人企业文化','聚人企业文化体系\n一、企业愿景：做美业受人尊敬的幸福企业！\n二、企业使命：帮助客户成功，成就员工梦想！\n三、企业价值观：客户第一，自律勤奋，正念利他，创新共赢，追求卓越。\n四、企业精神：真诚、务实、高效、奉献！\n五、企业作风：勇于负责，马上行动，绝对服从，没有借口，说到做到！\n聚人企业理念\n一、管理理念：严格就是大爱！被迫成长，被迫成功！让平凡的人创造不平凡的业绩！\n二、用人理念：用做事有结果的人，用对自己要求高的人，用逆境商高的人，用价值观一致的人。\n三、团队理念：坦诚沟通，互帮互助；学习成长，感恩相伴！\n四、服务理念：紧盯目标，寻找一切方法，付出200%努力，确保100%的结果！\n五、营销理念：找出业绩增长路径+精细管理客户需求+强化自我竞争优势+建立持续合作关系。\n六、学习成长理念：问题就是机会，为解决问题而练习的过程就是成长，每一次准备到令自己感动，每一次复习到令自己兴奋，每一次演练到令自己赞赏。\n七、工作理念：专业的事重复做你就是专家，重复的事用心做你就是赢家。\n八、聚人六项精进实现梦想：\n1、付出不亚于任何人的努力 \n2、要谦虚，不要骄傲\n3、每天都要反省 4、活着就要感谢\n5、积善行、思利他 6、不要有感性的烦恼',466,276,1,'2019-12-27 08:46:47','2019-12-27 08:46:47'),(48,'公司制度','111',463,316,1,'2019-12-17 01:36:36','2019-12-17 01:36:36'),(49,'12313213','1231231',66,206,0,'2019-12-26 04:40:45','2019-12-26 04:40:45'),(50,'1123.,,;','1',66,206,0,'2019-12-26 14:08:14','2019-12-26 14:08:14'),(51,'12','12',66,206,0,'2019-12-26 09:42:24','2019-12-26 09:42:24'),(52,'2','2',66,206,1,'2019-12-26 09:38:58','2019-12-26 09:38:58'),(53,'4','4',66,206,0,'2019-12-26 09:43:50','2019-12-26 09:43:51'),(54,'5','5',66,206,1,'2019-12-26 09:38:03','2019-12-26 09:38:03'),(55,'6','6',66,206,1,'2019-12-26 09:38:08','2019-12-26 09:38:08'),(56,'7','7',66,206,1,'2019-12-26 09:38:12','2019-12-26 09:38:12'),(57,'8','8',66,206,1,'2019-12-26 09:38:17','2019-12-26 09:38:17'),(58,'9','9',66,206,1,'2019-12-26 09:38:24','2019-12-26 09:38:24'),(59,'112','112',66,206,0,'2019-12-26 09:42:16','2019-12-26 09:42:17'),(60,'1212','1212',66,206,1,'2019-12-26 09:43:57','2019-12-26 09:43:57'),(61,'zzh','zzh',66,206,1,'2019-12-26 09:48:40','2019-12-26 09:48:40'),(62,'yk','yk',66,206,1,'2019-12-26 09:48:48','2019-12-26 09:48:48'),(63,'fz','fz',66,206,1,'2019-12-26 09:48:53','2019-12-26 09:48:53'),(64,'llk','llk',66,206,0,'2019-12-26 14:08:18','2019-12-26 14:08:19'),(65,'tt