1 09:05:16','2019-12-11 09:05:16'),(42,'POSTER','店内海报','lr-resource/5d/53/5d53b6cea2461f44b63a3e78e651dcb3,lr-resource/c7/0b/c70b6fc2e21268cd275c763a8ba2b89d',468,308,1,'2019-12-11 09:18:28','2019-12-11 09:18:29'),(43,'NOTICE','公告','大家今天5点开会',469,309,1,'2019-12-11 17:15:06','2019-12-11 17:15:06'),(44,'NOTICE','公告','鸡窝头算了算完。\n拴上班呢么么么叽叽歪歪',468,308,1,'2019-12-11 17:33:20','2019-12-11 17:33:20'),(45,'SYSTEM','公司制度','聚人企业文化体系\n一、企业愿景：做美业受人尊敬的幸福企业！\n二、企业使命：帮助客户成功，成就员工梦想！\n三、企业价值观：客户第一，自律勤奋，正念利他，创新共赢，追求卓越。\n四、企业精神：真诚、务实、高效、奉献！\n五、企业作风：勇于负责，马上行动，绝对服从，没有借口，说到做到！\n聚人企业理念\n一、管理理念：严格就是大爱！被迫成长，被迫成功！让平凡的人创造不平凡的业绩！\n二、用人理念：用做事有结果的人，用对自己要求高的人，用逆境商高的人，用价值观一致的人。\n三、团队理念：坦诚沟通，互帮互助；学习成长，感恩相伴！\n四、服务理念：紧盯目标，寻找一切方法，付出200%努力，确保100%的结果！\n五、营销理念：找出业绩增长路径+精细管理客户需求+强化自我竞争优势+建立持续合作关系。\n六、学习成长理念：问题就是机会，为解决问题而练习的过程就是成长，每一次准备到令自己感动，每一次复习到令自己兴奋，每一次演练到令自己赞赏。\n七、工作理念：专业的事重复做你就是专家，重复的事用心做你就是赢家。\n八、聚人六项精进实现梦想：\n1、付出不亚于任何人的努力 \n2、要谦虚，不要骄傲\n3、每天都要反省 4、活着就要感谢\n5、积善行、思利他 6、不要有感性的烦恼',466,276,1,'2019-12-26 00:48:38','2019-12-26 00:48:39'),(46,'NOTICE','公告','2020年1月11日年会，各团队准备好节目！',463,255,1,'2019-12-13 13:26:34','2019-12-13 13:26:34'),(47,'NOTICE','公告','大家做好年终冲刺时\n也要准备好年会的节目\n大家做好年终冲刺时\n也要准备好年会的节目',466,276,1,'2019-12-17 04:38:12','2019-12-17 04:38:13'),(48,'SYSTEM','公司制度','111',463,316,1,'2019-12-17 01:36:36','2019-12-17 01:36:36');
