DROP TABLE IF EXISTS `t_task_record`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_task_record` (
  `id` bigint(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `task_no` bigint(11) NOT NULL COMMENT '任务编号',
  `complete_time` datetime NOT NULL COMMENT '完成日期',
  `complete_count` int(11) NOT NULL COMMENT '完成次数',
  `emp_no` bigint(11) NOT NULL COMMENT '员工编号',
  `reward_point` int(11) NOT NULL COMMENT '奖励积分',
  `is_rewarded` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否奖励',
  `reward_time` datetime DEFAULT NULL COMMENT '奖励发放时间',
  `shop_no` bigint(11) NOT NULL COMMENT '美容院编码',
  `creator` bigint(11) DEFAULT NULL COMMENT '记录创建者',
  `is_valid` tinyint(1) NOT NULL COMMENT '删除标志',
  `gmt_create` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modify` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=181 DEFAULT CHARSET=utf8;
